import React, { useEffect, useState } from 'react';

import './css/About.css';
import Services from './Services';
import Separater from './Separater';

import Loader from './Loader';
import Calls from './Calls';

export default function About() {

    const [data, setData] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
      fetch(Calls.getCommandUri() + '/cv/about')
        .then(response => {
          if (response.ok) {
            return response.json();
          }
          throw response;
        })
        .then(data => {
          setData(data);
          setLoading(false);
        })
        .catch(error => {
          console.error("Error fetching data: ", error);
          setLoading(false);
        })
    }, [])

    const renderContent = (
      <>
        <p className='Paragraf'>
          <i>
          <span className='Highligh-Green-Text'><strong>{data.old} let</strong></span>
          <span className='Seperater-Title'>/</span>
          <span className='Highligh-Green-Text'><strong>{data.home}</strong></span>
          <span className='Seperater-Title'>/</span>
          <span className='Highligh-Green-Text'><strong>{data.position}</strong></span>
          </i>
        </p>
        <p className='About-Text Paragraf'>
          {data.about}
        </p>
       </>
    );

    return (
      <div className='Section'>
        <p>
          <strong className='Titles AboutMe'>Ãšvod</strong>
        </p>
        {loading ? <Loader /> : renderContent }
        <Separater />
        <Services />
      </div>
    );
}
